    @Test
    public void parseStat() throws IOException {

        Map<String, StatModel> allPartitions = new HashMap<>();

        list.stream()
                .map(s -> parsePartition(s))
                .forEach(map -> map.entrySet()
                        .forEach(stringStatModelEntry ->
                                addToResult(allPartitions, stringStatModelEntry)
                        ));

        countForRegexp(allPartitions, ".*2018.*", ".*2019.*");
        countForRegexp(allPartitions, "mastercard.*2018.*", "mastercard.*2019.*");
        countForRegexp(allPartitions, "visa.*2018.*", "visa.*2019.*");
        countForRegexp(allPartitions, "nspkmir.*2018.*", "nspkmir.*2019.*");
        countForRegexp(allPartitions, "maestro.*2018.*", "maestro.*2019.*");
        countForRegexp(allPartitions, "unionpay.*2018.*", "unionpay.*2019.*");
        countForRegexp(allPartitions, "visaelectron.*2018.*", "visaelectron.*2019.*");
        countForRegexp(allPartitions, "payment_terminal.*2018.*", "payment_terminal.*2019.*");
        countForRegexp(allPartitions, "jcb.*2018.*", "jcb.*2019.*");
        countForRegexp(allPartitions, "crypto_cur.*2018.*", "crypto_cur.*2019.*");
        countForRegexp(allPartitions, "amex.*2018.*", "amex.*2019.*");
        countForRegexp(allPartitions, "mobile.*2018.*", "mobile.*2019.*");
        countForRegexp(allPartitions, "dinersclub.*2018.*", "dinersclub.*2019.*");

        Map<String, StatModel> allPartitionsStatus = new HashMap<>();

        listStatus.stream()
                .map(s -> parsePartition(s))
                .forEach(map -> map.entrySet()
                        .forEach(stringStatModelEntry ->
                                addToResult(allPartitionsStatus, stringStatModelEntry)
                        ));

        for (PaymentStatus value : PaymentStatus.values()) {
            calcCountTwoYears(allPartitionsStatus, value.name() + ".*2018.*", value.name() + ".*2019.*");
        }
    }

    private void countForRegexp(Map<String, StatModel> allPartitions, String regexp2018, String regexp2019) {
        calcCountTwoYears(allPartitions, regexp2018, regexp2019);

        calcStatByCurrency(allPartitions, regexp2018);
        calcStatByCurrency(allPartitions, regexp2019);
    }

    private void calcCountTwoYears(Map<String, StatModel> allPartitions, String regexp2018, String regexp2019) {
        Long count_2018 = calcCountRegexp(allPartitions, regexp2018);
        Long count_2019 = calcCountRegexp(allPartitions, regexp2019);
        System.out.println("---------------\nCount - " + regexp2018 + ": " + count_2018 + " " + regexp2019 + ": " + count_2019);
    }

    @NotNull
    private Long calcCountRegexp(Map<String, StatModel> allPartitions, String regexp) {
        return allPartitions.entrySet()
                .stream()
                .filter(entry -> entry.getKey().matches(regexp))
                .mapToLong(value -> value.getValue().getCount()).sum();
    }

    private void calcStatByCurrency(Map<String, StatModel> allPartitions, String regexp2019) {
        sumByRegexp(allPartitions, regexp2019, "RUB");
        sumByRegexp(allPartitions, regexp2019, "EUR");
        sumByRegexp(allPartitions, regexp2019, "USD");
    }

    private StatModel sumByRegexp(Map<String, StatModel> allPartitions, String regexp, String currency) {
        long sum = allPartitions.entrySet()
                .stream()
                .filter(entry -> entry.getKey().matches(regexp) && entry.getKey()
                        .matches(".*" + currency + ".*"))
                .mapToLong(value -> value.getValue().getSum())
                .sum();
        long count = allPartitions.entrySet()
                .stream()
                .filter(entry -> entry.getKey().matches(regexp) && entry.getKey()
                        .matches(".*" + currency + ".*"))
                .mapToLong(value -> value.getValue().getCount())
                .sum();
        long average = 0l;
        if (count != 0) {
            average = sum / count;
        }

        System.out.println(regexp + " " + currency + ": " + sum + " count: " + count + " average: " + average);

        StatModel statModel = new StatModel();
        statModel.setSum(sum);
        statModel.setCount(count);
        return statModel;
    }

    private void addToResult(Map<String, StatModel> allPartitions, Map.Entry<String, StatModel> entry) {
        StatModel statModel = allPartitions.get(entry.getKey());
        if (statModel == null) {
            allPartitions.put(entry.getKey(), entry.getValue());
        } else {
            statModel.setCount(statModel.getCount() + entry.getValue().getCount());
            statModel.setSum(statModel.getSum() + entry.getValue().getSum());
        }
    }

    @NotNull
    private Map<String, StatModel> parsePartition(String str) {
        Properties props = new Properties();
        try {
            props.load(new StringReader(str.substring(1, str.length() - 1).replace("), ", "\n")
                    .replace(")", "\n")
                    .replace("StatModel(", "")));
        } catch (IOException e) {
            e.printStackTrace();
        }
        Map<String, StatModel> map2 = new HashMap<String, StatModel>();
        for (Map.Entry<Object, Object> e : props.entrySet()) {

            StatModel statModel = parsStatModel(e);

            map2.put((String) e.getKey(), statModel);

        }
        return map2;
    }

    private StatModel parsStatModel(Map.Entry<Object, Object> e) {
        StatModel statModel = new StatModel();
        String stat = (String) e.getValue();

        String pattern = "sum=(.*), count=(.*)";

        // Create a Pattern object
        Pattern r = Pattern.compile(pattern);

        // Now create matcher object.
        Matcher m = r.matcher(stat);

        if (m.find()) {
            statModel.setSum(Long.valueOf(m.group(1)));
            statModel.setCount(Long.valueOf(m.group(2)));
        } else {
            System.out.println("NO MATCH");
        }

        return statModel;
    }

